import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <>
      <header className="header">
        <div className="logo">Tasty Bites</div>
        <nav className="navbar">
          <a href="/">Home</a>
          <a href="/account">Account</a>
          <a href="/cart">Cart</a>
          <button className="btn-logout">Logout</button>
        </nav>
      </header>

      <main className="main-content">
        <section className="food-suggestions">
          <h2>Food Suggestions</h2>
          {/* Food suggestions content here */}
        </section>
        <section className="restaurant-chains">
          <h2>Restaurant Chains</h2>
          {/* Restaurant chains content here */}
        </section>
      </main>

      <footer className="footer">
        &copy; {new Date().getFullYear()} Tasty Bites. All rights reserved.
      </footer>
    </>
  );
};

export default Home;
